import React from 'react';
import placeholder from "../../placeholder.png";

const FriendsList = props => {

    const username = "Mark";
    return (
        <div className="flex flex-col">
            <div id="profile"className="h-16 text-xl flex flex-auto "> <img className ="rounded-full"src ={placeholder}/> {username}</div>
            <div id="friends" className="text-xl h-auto border-solid border-b-2 border-black flex flex-col" >friends</div>

            <div id="chats" className="text-xl h-auto border-solid border-b-2 border-black flex flex-col">chats</div>


        </div>
    )
}



export default FriendsList;
